eDijkstraAlgorithm(int[,] graph, int src)\n    {\n        int[] dist = new int[vertexQuantity]; \n        bool[] sptSet = new bool[vertexQuantity];\n\n        for (int i = 0; i \u003C vertexQuantity; i\u002B\u002B)\n        {\n            dist[i] = int.MaxValue;\n            sptSet[i] = false;\n        }\n\n        dist[src] = 0;\n\n        for (int count = 0; count \u003C vertexQuantity - 1; count\u002B\u002B)\n        {\n            int u = FindMinDistance(dist, sptSet);\n\n            sptSet[u] = true;\n\n            for (int v = 0; v \u003C vertexQuantity; v\u002B\u002B)\n                if (!sptSet[v] \u0026\u0026 graph[u, v] != 0 \u0026\u0026\n                     dist[u] != int.MaxValue \u0026\u0026 dist[u] \u002B graph[u, v] \u003C dist[v])\n                    dist[v] = dist[u] \u002B graph[u, v];\n        }\n\n        PrintSolution(dist, vertexQuantity);\n    }\n\n    public static void PrintGraph(int[,] graph)\n    {\n        int graphWidth = graph.GetLength(0);\n        int graphHeight = graph.GetLength(1);\n\n        Console.ForegroundColor = ConsoleColor.Yellow;\n        Console.WriteLine(\u0022Algorym Dijkistry zosta\u0142 zastosowany dla nast\u0119puj\u0105cej macierzy:\u0022);\n        if (graphHeight \u003E 0 \u0026\u0026 graphWidth \u003E 0)\n        {\n            for (int col = 0; col \u003C graphWidth; col\u002B\u002B)\n            {\n                for (int row = 0; row \u003C graphHeight; row\u002B\u002B)\n                {\n                    Console.Write($\u0022{graph[col, row]} \u0022);\n                }\n                Console.Write(\u0022\\n\u0022);\n            }\n        }\n        Console.ForegroundColor = ConsoleColor.Gray;\n        Console.WriteLine(\u0022\\n\u0022);\n    }\n}","mutants":[{"id":"208","mutatorName":"Block removal mutation","replacement":"{}","location":{"start":{"line":11,"column":5},"end":{"line":22,"column":6}},"status":"Ignored","statusReason":"Removed by block already covered filter","static":false,"coveredB tient = (p - 1) * (q - 1);\n\n            for (long i = 2; i \u003C totient; i\u002B\u002B)\n            {\n                if (totient % i == 0)\n                    continue;\n\n                if (IsPrime(i) \u0026\u0026 i != p \u0026\u0026 i != q)\n                {\n                    long exp = GetDecryptExp(i, totient);\n                    if (exp \u003E 0)\n                    {\n                        list.Add(i);\n                        list.Add(exp);\n                    }\n\n                    if (list.Count \u003E maxLength - 1)\n                        break;\n                }\n            }\n\n            return list.ToArray();\n        }\n\n        // Get the encryption exponent (e).\n        public static long GetEncryptExp(long p, long q)\n        {\n            long totient = (p - 1) * (q - 1);\n            for (long i = 2; i \u003C totient; i\u002B\u002B)\n            {\n                if (totient % i == 0)\n                    continue;\n\n                if (IsPrime(i) \u0026\u0026 i != p \u0026\u0026 i != q)\n                {\n                    long exp = GetDecryptExp(i, totient);\n                    if (exp \u003E 0)\n                        return i;\n                }\n            }\n\n            return 0;\n        }\n\n        // Get Decryption exponent (d).\n        public static long GetDecryptExp(long x, long t)\n        {\n            long k = 1;\n            while (true)\n            {\n                k = k \u002B t;\n                if (k % x == 0)\n                    return k / x;\n            }\n        }\n\n        public static long[] Encrypt(long key, long modulus, string msg)\n        {\n            int len = msg.Length;\n\n            // encrypted \n            long[] en = new long[len];\n\n            for (int i = 0; i \u003C msg.Length; i\u002B\u002B)\n            {\n                // plain text\n                long pt = msg[i];\n                long k = 1;\n                for (long j = 0; j \u003C key; j\u002B\u002B)\n                {\n                    k = MulMod(k, pt, modulus);\n                }\n\n                // cipher text\n                en[i] = k \u002B 96;\n            }\n\n            return en;\n        }\n\n\n        /// \u003Csummary\u003E\n        /// Decrypt encrypted text;\n        /// \u003C/summary\u003E\n        /// \u003Cparam name=\u0022en\u0022\u003Eencrypted text\u003C/param\u003E\n        /// \u003Cparam name=\u0022key\u0022\u003Ekey\u003C/param\u003E\n        /// \u003Cparam name=\u0022n\u0022\u003Emodulus\u003C/param\u003E\n        /// \u003Creturns\u003E\u003C/returns\u003E\n        public static string Decrypt(long key, long modulus, long[] en)\n        {\n            StringBuilder sb = new StringBuilder();\n            for (int i = 0; i \u003C en.Length; i\u002B\u002B)\n            {\n                // cipher text\n                long ct = en[i] - 96;\n                long k = 1;\n                for (long j = 0; j \u003C key; j\u002B\u002B)\n                {\n                    k = MulMod(k, ct, modulus);\n                }\n\n                // Get positive modulo.\n                const long n = 256;\n                k = PosMod(k, n);\n                sb.Append(Convert.ToChar(k));\n            }\n\n            return sb.ToString();\n        }\n\n        // Modular Multiplication. Return (a * b) % mod.  Prevents most overflows.\n        // Overflows when (a % mod) * (b % mod) is greater than 64 bits.\n        // Overflows when modulus is greater than 10 million.\n        public static long MulMod(long a, long b, long mod)\n        {\n            return ((a % mod) * (b % mod)) % mod;\n        }\n\n        // Return (a * b) % mod.  No overflow.  \n        public static long MulModTwo(long a, long b, long mod)\n        {\n            long result = 0; \n            a = a % mod;\n            while (b \u003E 0)\n            {\n                // If b is odd, add \u0027a\u0027 to result. \n                if (b % 2 == 1)\n    // Assert\n        Assert.Equal(new int[] { 1, 0, 0, 2, 3, 0, 0, 4, 5 }, result);\n    }\n\n    [Fact]\n    public void DuplicateZeros_ShouldReturnArrayWithZerosDuplicatedOnlyOnce_WhenConsecutiveZerosPresent()\n    {\n        // Arrange\n        int[] arr = { 1, 0, 0, 2, 0, 3, 4 };\n\n        // Act\n        int[] result = DoubleZeroArray.DuplicateZeros(arr);\n\n        // Assert\n        Assert.Equal(new int[] { 1, 0, 0, 0, 0, 2, 0, 3, 4 }, result);\n    }\n\n    [Fact]\n    public void DuplicateZeros_ShouldReturnArrayWithDuplicatedZerosAtEnd_WhenZerosAtEndPresent()\n    {\n        // Arrange\n        int[] arr = { 1, 2, 0, 0 };\n\n        // Act\n        int[] result = DoubleZeroArray.DuplicateZeros(arr);\n\n        // Assert\n        Assert.Equal(new int[] { 1, 2, 0, 0 }, result);\n    }\n\n    [Fact]\n    public void DuplicateZeros_ShouldReturnEmptyArray_WhenInputArrayIsEmpty()\n    {\n        // Arrange\n        int[] arr = { };\n\n        // Act\n        int[] result = DoubleZeroArray.DuplicateZeros(arr);\n\n        // Assert\n        Assert.Empty(result);\n    }\n}","tests":[{"id":"1f9ae5b2-95db-9b73-d00d-632ea23b285a","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.DoubleZeroArrayTests.DuplicateZeros_ShouldReturnUnchangedArray_WhenNoZerosPresent","location":{"start":{"line":7,"column":5},"end":{"line":18,"column":6}}},{"id":"d39f5e79-12cf-c6a4-2b57-62dc42763e3e","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.DoubleZeroArrayTests.DuplicateZeros_ShouldReturnArrayWithZerosDuplicated_WhenZerosPresent","location":{"start":{"line":20,"column":5},"end":{"line":31,"column":6}}},{"id":"db6dc122-eebb-62ec-7c0c-374e33d994a6","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.DoubleZeroArrayTests.DuplicateZeros_ShouldReturnArrayWithZerosDuplicatedOnlyOnce_WhenConsecutiveZerosPresent","location":{"start":{"line":33,"column":5},"end":{"line":44,"column":6}}},{"id":"2cda6dba-9f84-228c-0277-f54728b51ac0","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Promp  void FindNumbers_ShouldReturnCorrectCount_ForDifferentArrays(int[] nums, int expected)\n    {\n        // Act\n        int result = FindNumberWithEvenDigitsNum.FindNumbers(nums);\n\n        // Assert\n        Assert.Equal(expected, result);\n    }\n}","tests":[{"id":"09422cda-ee4d-34b2-b0ab-fcc1d78ef248","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.FindNumberWithEvenDigitsNumTests.FindNumbers_ShouldReturnCorrectCount_ForDifferentArrays","location":{"start":{"line":7,"column":5},"end":{"line":24,"column":6}}},{"id":"67bbb48f-a032-96fa-8119-a9981bf6807a","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.FindNumberWithEvenDigitsNumTests.FindNumbers_ShouldReturnCorrectCount_ForDifferentArrays","location":{"start":{"line":7,"column":5},"end":{"line":24,"column":6}}},{"id":"54b6ccfe-8245-b113-5637-c652b88102e2","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.FindNumberWithEvenDigitsNumTests.FindNumbers_ShouldReturnCorrectCount_ForDifferentArrays","location":{"start":{"line":7,"column":5},"end":{"line":24,"column":6}}},{"id":"b6906ff9-71f5-4bc1-c83a-e892576d91a9","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.FindNumberWithEvenDigitsNumTests.FindNumbers_ShouldReturnCorrectCount_ForDifferentArrays","location":{"start":{"line":7,"column":5},"end":{"line":24,"column":6}}},{"id":"54d07167-18b2-4f70-225f-41af09e1f6f0","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.FindNumberWithEvenDigitsNumTests.FindNumbers_ShouldReturnCorrectCount_ForDifferentArrays","location":{"start":{"line":7,"column":5},"end":{"line":24,"column":6}}},{"id":"8a30f359-79c4-fef0-1b5f-1d990b14cf58","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.FindNumberWithEvenDigitsNumTests.FindNumbers_ShouldReturnCorrectCount_ForDifferentArrays","location":{"start":{"line":7,"column":5},"end":{"line":24,"column":6}}},{"id":"86ed903e-4e14-ec3c-6323-7cf31053fca0","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.FindNumberWithEvenDigitsNumTests.FindNumbers_ShouldReturnCorrectCou .Item1); // Area = (base * height) / 2\n        Assert.Equal(5 \u002B 12 \u002B 10, result.Item2); // Perimeter = base \u002B side1 \u002B side2\n    }\n\n    [Fact]\n    public void TriangleShape_Area_ShouldReturnCorrectResult_WithCustomValues()\n    {\n        // Arrange\n        float _base = 6;\n        float height = 12;\n        float side1 = 8;\n        float side2 = 10;\n\n        // Act\n        var result = GeometricShapes.TriangleShape.Area(_base, height, side1, side2);\n\n        // Assert\n        Assert.Equal((_base * height) / 2, result.Item1); // Area = (base * height) / 2\n        Assert.Equal(_base \u002B side1 \u002B side2, result.Item2); // Perimeter = base \u002B side1 \u002B side2\n    }\n\n    [Fact]\n    public void SquareShape_Area_ShouldReturnCorrectResult_WithDefaultValues()\n    {\n        // Act\n        var result = GeometricShapes.SquareShape.Area();\n\n        // Assert\n        Assert.Equal(12 * 12, result.Item1); // Area = side * side\n        Assert.Equal(4 * 12, result.Item2); // Perimeter = 4 * side\n    }\n\n    [Fact]\n    public void SquareShape_Area_ShouldReturnCorrectResult_WithCustomValues()\n    {\n        // Arrange\n        float side = 8;\n\n        // Act\n        var result = GeometricShapes.SquareShape.Area(side);\n\n        // Assert\n        Assert.Equal(side * side, result.Item1); // Area = side * side\n        Assert.Equal(4 * side, result.Item2); // Perimeter = 4 * side\n    }\n\n    [Fact]\n    public void CircleShape_Area_ShouldReturnCorrectResult_WithDefaultValues()\n    {\n        // Act\n        var result = GeometricShapes.CircleShape.Area();\n\n        // Assert\n        Assert.Equal(3.14 * 20 * 20, result.Item1); // Area = \u03C0 * radius * radius\n        Assert.Equal(4 * 3.14 * 20, result.Item2); // Circumference = 2 * \u03C0 * radius\n    }\n\n    [Fact]\n    public void CircleShape_Area_ShouldReturnCorrectResult_WithCustomValues()\n    {\n        // Arrange\n        float radius = 15;\n\n        // Act\n        var result = GeometricShapes.CircleShape.Area(radius);\n\n        // Assert\n        Assert.Equal(3.14 * radius * radius, result.Item1); // Area = \u03C0 * radius * radius\n        Assert.Equal(4 * 3.14 * radius, result.Item2); // Circumference = 2 * \u03C0 * radius\n    }\n}","tests":[{"id":"fa5a05ec-75df-e1f5-5550-305c8cba21c5","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.GeometricShapesTests.RectangleShape_Area_ShouldReturnCorrectResult_WithDefaultValues","location":{"start":{"line":7,"column":1},"end":{"line":16,"column":6}}},{"id":"cb3b8848-66f6-d0c0-cb8b-59c8f5a0815c","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.GeometricShapesTests.RectangleShape_Area_ShouldReturnCorrectResult_WithCustomValues","location":{"start":{"line":18,"column":5},"end":{"line":31,"column":6}}},{"id":"5069e8a7-19af-e6da-0819-fedf7ddf9212","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.GeometricShapesTests.TriangleShape_Area_ShouldReturnCorrectResult_WithDefaultValues","location":{"start":{"line":33,"column":5},"end":{"line":42,"column":6}}},{"id":"15398001-ea81-d5a0-bc33-7a3ccaae1647","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.GeometricShapesTests.TriangleShape_Area_ShouldReturnCorrectResult_WithCustomValues","location":{"start":{"line":44,"column":5},"end":{"line":59,"column":6}}},{"id":"a1145a8f-4298-7d44-0a5f-6dc6b3f6e87b","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.GeometricShapesTests.SquareShape_Area_ShouldReturnCorrectResult_WithDefaultValues","location":{"start":{"line":61,"column":5},"end":{"line":70,"column":6}}},{"id":"571bd069-c8d0-3d68-f0a7-6fbafc5d2f18","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.GeometricShapesTests.SquareShape_Area_ShouldReturnCorrectResult_WithCustomValues","location":{"start":{"line":72,"column":5},"end":{"line":84,"column":6}}},{"id":"c9036de9-adde-ad0b-3fa6-db3ae1d0359d","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.GeometricShapesTests.CircleShape_Area_ShouldReturnCorrectRes al age, no kids\n    [InlineData(18, 18, true)] // Both persons at legal age, with kids\n    public void CanGetFamilyLoan_ShouldReturnTrue_ForEligiblePersons(byte firstPersonAge, byte secondPersonAge, bool haveKids)\n    {\n        // Act\n        bool result = LoanApplication.CanGetFamilyLoan(firstPersonAge, secondPersonAge, haveKids);\n\n        // Assert\n        Assert.True(result);\n    }\n\n    [Theory]\n    [InlineData(15, 15, false)] // Both persons below legal age, no kids\n    [InlineData(15, 17, false)] // First person below legal age, second person at legal age, no kids\n    [InlineData(17, 15, false)] // First person at legal age, second person below legal age, no kids\n    [InlineData(15, 15, true)] // Both persons below legal age, with kids\n    [InlineData(17, 17, false)] // Both persons at legal age, no kids\n    public void CanGetFamilyLoan_ShouldReturnFalse_ForIneligiblePersons(byte firstPersonAge, byte secondPersonAge, bool haveKids)\n    {\n        // Act\n        bool result = LoanApplication.CanGetFamilyLoan(firstPersonAge, secondPersonAge, haveKids);\n\n        // Assert\n        Assert.False(result);\n    }\n}","tests":[{"id":"0b2958dd-8575-bc8d-890c-b2e586d13745","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.LoadApplicationTests.CanGetFamilyLoan_ShouldReturnTrue_ForEligiblePersons","location":{"start":{"line":7,"column":5},"end":{"line":23,"column":6}}},{"id":"72a76765-6247-9220-c6a5-b2d1e329c657","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.LoadApplicationTests.CanGetFamilyLoan_ShouldReturnTrue_ForEligiblePersons","location":{"start":{"line":7,"column":5},"end":{"line":23,"column":6}}},{"id":"6b5654a9-64bf-b6c1-3912-1ff8ef2d037d","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.LoadApplicationTests.CanGetFamilyLoan_ShouldReturnTrue_ForEligiblePersons","location":{"start":{"line":7,"column":5},"end":{"line":23,"column":6}}},{"id":"ab0e8bc4-17a3-8fd1-cecc-57c3b4f2fa8b","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Promp      Assert.Equal(0, result);\n    }\n\n    [Fact]\n    public void CheckForMultiCards_ShouldHandleInvalidValuesInValueCounters()\n    {\n        // Arrange\n        string[] valueCounters = { \u0022card1|3\u0022, \u0022invalid\u0022, \u0022card2|4\u0022 }; // Invalid value in the middle\n        int valueCount = 3;\n\n        // Act\n        int result = MultiCardsCheck.CheckForMultiCards(valueCounters, valueCount);\n\n        // Assert\n        Assert.Equal(1, result); // Expecting 1 card with value count 3\n    }\n\n    [Fact]\n    public void CheckForMultiCards_ShouldHandleEmptyValueCounters()\n    {\n        // Arrange\n        string[] valueCounters = { \u0022\u0022, \u0022\u0022, \u0022\u0022 }; // Empty value counters\n        int valueCount = 0; // Check for cards with value count 0\n\n        // Act\n        int result = MultiCardsCheck.CheckForMultiCards(valueCounters, valueCount);\n\n        // Assert\n        Assert.Equal(0, result);\n    }\n}","tests":[{"id":"068ede2f-cd70-1e25-9aec-f27560c39428","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.MultiCardsCheckTests.CheckForMultiCards_ShouldReturnCorrectCount_ForValidValueCount","location":{"start":{"line":7,"column":5},"end":{"line":19,"column":6}}},{"id":"f70c3c31-fabd-25b9-1edd-7c248fb689d7","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.MultiCardsCheckTests.CheckForMultiCards_ShouldReturnZero_ForInvalidValueCount","location":{"start":{"line":21,"column":5},"end":{"line":33,"column":6}}},{"id":"fdc395c3-eda7-1589-c478-0b0c36fa67cf","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.MultiCardsCheckTests.CheckForMultiCards_ShouldReturnCorrectCount_ForEmptyValueCounters","location":{"start":{"line":35,"column":5},"end":{"line":47,"column":6}}},{"id":"ab8aa042-9f27-a9f7-5893-ed155920f395","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.MultiCardsCheckTests.CheckForMultiCards_ShouldHandleInvalidValuesInValueCounters","location":{"start":{"line":49,"column":5},"end":{"line":61,"column" ; // Array with all elements same\n\n        // Act\n        int result = RemoveArrayDuplicates.RemoveDuplicates(nums);\n\n        // Assert\n        Assert.Equal(1, result); // Expecting length 1\n        Assert.Equal(new int[] { 1, 1, 1, 1, 1 }, new int[] { 1, 1, 1, 1, 1 }); // Expecting array to remain unchanged\n    }\n\n    [Fact]\n    public void RemoveDuplicates_ShouldHandleArrayWithNoDuplicates()\n    {\n        // Arrange\n        int[] nums = { 1, 2, 3, 4, 5 }; // Array with no duplicates\n\n        // Act\n        int result = RemoveArrayDuplicates.RemoveDuplicates(nums);\n\n        // Assert\n        Assert.Equal(5, result); // Expecting length 5\n        Assert.Equal(new int[] { 1, 2, 3, 4, 5 }, new int[] { 1, 2, 3, 4, 5 }); // Expecting array to remain unchanged\n    }\n}","tests":[{"id":"67cc5107-248e-ba97-97fa-cefe14dc4024","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.RemoveArrayDuplicatesTests.RemoveDuplicates_ShouldRemoveDuplicates_AndReturnCorrectLength","location":{"start":{"line":7,"column":5},"end":{"line":19,"column":6}}},{"id":"546bc270-8aae-f57f-2fb3-5044026d499d","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.RemoveArrayDuplicatesTests.RemoveDuplicates_ShouldHandleEmptyArray","location":{"start":{"line":21,"column":5},"end":{"line":33,"column":6}}},{"id":"714cd2a5-9139-ca38-a8c5-e524821858b2","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.RemoveArrayDuplicatesTests.RemoveDuplicates_ShouldHandleArrayWithSingleElement","location":{"start":{"line":35,"column":5},"end":{"line":47,"column":6}}},{"id":"82b81381-a7f9-5cb9-2fee-0c157ed66284","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.RemoveArrayDuplicatesTests.RemoveDuplicates_ShouldHandleArrayWithAllElementsSame","location":{"start":{"line":49,"column":5},"end":{"line":61,"column":6}}},{"id":"c9e298ad-16ff-c433-f89c-aac3e3b53d17","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.RemoveArrayDuplicatesTests.RemoveDuplicates_ShouldHandleArrayWithNoDuplicates","location":{"start":{"line":63,"column":5},"end":{"line":75,"column":6}}}]},"/Users/tomas/Documents/Code/bakis/UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3/SqrtFunctionTests.cs":{"language":"cs","source":"using UnitTestGeneration.Easy.App;\n\nnamespace UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3;\n\npublic class SqrtFunctionTests\n{\n    [Theory]\n    [InlineData(0, 0.0)] // Edge case: square root of 0\n    [InlineData(1, 0.0)] // Edge case: square root of 1\n    [InlineData(4, 0.0)] // Perfect square: square root of 4\n    [InlineData(9, 0.0)] // Perfect square: square root of 9\n    [InlineData(16, 0.0)] // Perfect square: square root of 16\n    [InlineData(25, 0.0)] // Perfect square: square root of 25\n    public void Sqrt_ShouldReturnCorrectResult_ForPerfectSquares(decimal x, decimal epsilon)\n    {\n        // Act\n        decimal result = SqrtFunction.Sqrt(x, epsilon);\n\n        // Assert\n        Assert.Equal((decimal)System.Math.Sqrt((double)x), result); // Expecting result to match system calculation for perfect squares\n    }\n\n    [Theory]\n    [InlineData(2, 0.1)] // Edge case: square root of 2 with epsilon 0.1\n    [InlineData(10, 0.01)] // Edge case: square root of 10 with epsilon 0.01\n    [InlineData(100, 0.001)] // Edge case: square root of 100 with epsilon 0.001\n    public void Sqrt_ShouldReturnCorrectResult_ForNonPerfectSquares(decimal x, decimal epsilon)\n    {\n        // Act\n        decimal result = SqrtFunction.Sqrt(x, epsilon);\n\n        // Assert\n        Assert.True(System.Math.Abs((decimal)System.Math.Sqrt((double)x) - result) \u003C= epsilon); // Expecting result to be within epsilon range of system calculation for non-perfect squares\n    }\n\n    [Fact]\n    public void Sqrt_ShouldThrowOverflowException_ForNegativeInput()\n    {\n        // Arrange\n        decimal x = -1;\n\n        // Act \u0026 Assert\n        Assert.Throws\u003COverflowException\u003E(() =\u003E SqrtFunction.Sqrt(x)); // Expecting OverflowException for negative input\n    }\n}","tests":[{"id":"8ee2a27a-aad3-421b-b47e-02e9c5e52ef2","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.SqrtFunctionTests.Sqrt_ShouldReturnCorrectResult_ForPerfectSquares","location":{"start":{"line":7,"column":5},"end":{"line":21,"column":6}}},{"id":"ac81d578-a666-0944-c915-27c146203acc","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.SqrtFunctionTests.Sqrt_ShouldReturnCorrectResult_ForPerfectSquares","location":{"start":{"line":7,"column":5},"end":{"line":21,"column":6}}},{"id":"83bbe10f-5e67-07c5-fe29-01bcc4893277","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.SqrtFunctionTests.Sqrt_ShouldReturnCorrectResult_ForPerfectSquares","location":{"start":{"line":7,"column":5},"end":{"line":21,"column":6}}},{"id":"5a4c3c09-4c84-1756-5832-6cf8a49c27a5","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.SqrtFunctionTests.Sqrt_ShouldReturnCorrectResult_ForPerfectSquares","location":{"start":{"line":7,"column":5},"end":{"line":21,"column":6}}},{"id":"e6608f82-703a-ef49-4212-eed0abd8d081","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.SqrtFunctionTests.Sqrt_ShouldReturnCorrectResult_ForPerfectSquares","location":{"start":{"line":7,"column":5},"end":{"line":21,"column":6}}},{"id":"667e60ac-b6f2-1d18-b843-d344a796b5d0","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.SqrtFunctionTests.Sqrt_ShouldReturnCorrectResult_ForPerfectSquares","location":{"start":{"line":7,"column":5},"end":{"line":21,"column":6}}},{"id":"a0612895-faa4-157a-cf5b-1520326fd2d5","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.SqrtFunctionTests.Sqrt_ShouldReturnCorrectResult_ForNonPerfectSquares","location":{"start":{"line":23,"column":5},"end":{"line":34,"column":6}}},{"id":"ba2885f4-83a6-9e48-f677-104f3766e5dd","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt3.SqrtFunctionTests.Sqrt_ShouldReturnCorrectResult_ForNonPerfectSquares","location":{"start":{"line":23,"column":5},"end":{"line":34,"column":6}}},{"id":"75b3394f-fcf2-3688-6eb5-2dd769bbdeee" .False(result);\n    }\n\n    [Fact]\n    public void IsPalindrome_ShouldReturnTrue_ForZero()\n    {\n        // Arrange\n        int number = 0;\n\n        // Act\n        bool result = CheckForPalindrome.IsPalindrome(number);\n\n        // Assert\n        Assert.True(result);\n    }\n\n    [Theory]\n    [InlineData(int.MinValue)]\n    [InlineData(int.MaxValue)]\n    public void IsPalindrome_ShouldHandleMinMaxIntegers(int number)\n    {\n        // Act\n        bool result = CheckForPalindrome.IsPalindrome(number);\n\n        // Assert\n        Assert.False(result); // Min and max integers are not palindromes\n    }\n}","tests":[{"id":"4f70c2a5-05ca-17b7-8ea1-5026ca1c2ab0","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt2.CheckForPalindromeTests.IsPalindrome_ShouldReturnTrue_ForPalindromicNumbers","location":{"start":{"line":7,"column":5},"end":{"line":19,"column":6}}},{"id":"ad0d3d3e-fecc-489f-cfa6-92b7f8360436","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt2.CheckForPalindromeTests.IsPalindrome_ShouldReturnTrue_ForPalindromicNumbers","location":{"start":{"line":7,"column":5},"end":{"line":19,"column":6}}},{"id":"28fc75f5-1e23-273a-e566-b04ef1735a41","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt2.CheckForPalindromeTests.IsPalindrome_ShouldReturnTrue_ForPalindromicNumbers","location":{"start":{"line":7,"column":5},"end":{"line":19,"column":6}}},{"id":"cedec1c6-b2fe-97e0-3d67-0a11c94a1840","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt2.CheckForPalindromeTests.IsPalindrome_ShouldReturnTrue_ForPalindromicNumbers","location":{"start":{"line":7,"column":5},"end":{"line":19,"column":6}}},{"id":"5587d485-47b3-6586-9834-008cf99e87ac","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt2.CheckForPalindromeTests.IsPalindrome_ShouldReturnFalse_ForNonPalindromicNumbers","location":{"start":{"line":21,"column":5},"end":{"line":33,"column":6}}},{"id":"66d65167-a179-a6a8-9308-94aa4649a5c2","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt2.CheckForPalin uldReturnCorrectCount","location":{"start":{"line":20,"column":5},"end":{"line":31,"column":6}}},{"id":"820656f5-d78a-5bbf-2a64-848065457792","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt2.FindNumberWithEvenDigitsNumTests.FindNumbers_ShouldReturnCorrectCount","location":{"start":{"line":20,"column":5},"end":{"line":31,"column":6}}},{"id":"240d4757-d181-6c03-3084-9a9aff35c774","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt2.FindNumberWithEvenDigitsNumTests.FindNumbers_ShouldReturnCorrectCount","location":{"start":{"line":20,"column":5},"end":{"line":31,"column":6}}},{"id":"f5a42d63-ced2-6362-624b-1fc221d1131b","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt2.FindNumberWithEvenDigitsNumTests.FindNumbers_ShouldHandleSingleDigitNumbers","location":{"start":{"line":33,"column":5},"end":{"line":44,"column":6}}}]},"/Users/tomas/Documents/Code/bakis/UnitTestGeneration.Easy.Tests.ChatGPT.Prompt2/GeometricShapesTests.cs":{"language":"cs","source":"using UnitTestGeneration.Easy.App;\n\nnamespace UnitTestGeneration.Easy.Tests.ChatGPT.Prompt2;\n\npublic class GeometricShapesTests\n{\n[Fact]\n    public void RectangleShape_Area_ShouldReturnCorrectResult_DefaultValues()\n    {\n        // Act\n        var result = GeometricShapes.RectangleShape.Area();\n\n        // Assert\n        Assert.Equal(12 * 22, result.Item1);\n        Assert.Equal(2 * (12 \u002B 22), result.Item2);\n    }\n\n    [Fact]\n    public void RectangleShape_Area_ShouldReturnCorrectResult_CustomValues()\n    {\n        // Arrange\n        float length = 15;\n        float breadth = 25;\n\n        // Act\n        var result = GeometricShapes.RectangleShape.Area(length, breadth);\n\n        // Assert\n        Assert.Equal(length * breadth, result.Item1);\n        Assert.Equal(2 * (length \u002B breadth), result.Item2);\n    }\n\n    [Fact]\n    public void TriangleShape_Area_ShouldReturnCorrectResult_DefaultValues()\n    {\n        // Act\n        var result = GeometricShapes.TriangleShape.Area();\n\n        // Assert\n        Assert.Equal(5 * 13 / 2, result.Item1);\n        Assert.Equal(5 \u002B 12 \u002B 10, result.Item2);\n    }\n\n    [Fact]\n    public void TriangleShape_Area_ShouldReturnCorrectResult_CustomValues()\n    {\n        // Arrange\n        float _base = 7;\n        float height = 15;\n        float side1 = 8;\n        float side2 = 11;\n\n        // Act\n        var result = GeometricShapes.TriangleShape.Area(_base, height, side1, side2);\n\n        // Assert\n        Assert.Equal(_base * height / 2, result.Item1);\n        Assert.Equal(_base \u002B side1 \u002B side2, result.Item2);\n    }\n\n    [Fact]\n    public void SquareShape_Area_ShouldReturnCorrectResult_DefaultValue()\n    {\n        // Act\n        var result = GeometricShapes.SquareShape.Area();\n\n        // Assert\n        Assert.Equal(12 * 12, result.Item1);\n        Assert.Equal(4 * 12, result.Item2);\n    }\n\n    [Fact]\n    public void SquareShape_Area_ShouldReturnCorrectResult_CustomValue()\n    {\n        // Arrange\n        float side = 10;\n\n        // Act\n        var result = GeometricShapes.SquareShape.Area(side);\n\n        // Assert\n        Assert.Equal(side * side, result.Item1);\n        Assert.Equal(4 * side, result.Item2);\n    }\n\n    [Fact]\n    public void CircleShape_Area_ShouldReturnCorrectResult_DefaultValue()\n    {\n        // Act\n        var result = GeometricShapes.CircleShape.Area();\n\n        // Assert\n        Assert.Equal(3.14 * 20 * 20, result.Item1);\n        Assert.Equal(4 * 3.14 * 20, result.Item2);\n    }\n\n    [Fact]\n    public void CircleShape_Area_ShouldReturnCorrectResult_CustomValue()\n    {\n        // Arrange\n        float radius = 15;\n\n        // Act\n        var result = GeometricShapes.CircleShape.Area(radius);\n\n        // Assert\n        Assert.Equal(3.14 * radius * radius, result.Item1);\n        Assert.Equal(4 * 3.14 * radius, result.Item2);\n    }\n}","tests":[{"id":"d5477af1-90b3-110f-8091-7c6b2592afe6","name":"Uni , result);\n    }\n\n    [Fact]\n    public void DuplicateZeros_EmptyArray_ReturnsEmptyArray()\n    {\n        // Arrange\n        int[] input = Array.Empty\u003Cint\u003E();\n        int[] expected = Array.Empty\u003Cint\u003E();\n\n        // Act\n        int[] result = DoubleZeroArray.DuplicateZeros(input);\n\n        // Assert\n        Assert.Equal(expected, result);\n    }\n\n    [Fact]\n    public void DuplicateZeros_MaximumLengthArray_ReturnsCorrectResult()\n    {\n        // Arrange\n        int[] input = Enumerable.Range(1, 100000).ToArray();\n        int[] expected = Enumerable.Range(1, 100000).Concat(Enumerable.Repeat(0, 100000)).ToArray();\n\n        // Act\n        int[] result = DoubleZeroArray.DuplicateZeros(input);\n\n        // Assert\n        Assert.Equal(expected.Take(100000), result);\n    }\n}","tests":[{"id":"3cbcfddc-ebe8-2d4b-27fd-a745b937cd30","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.DoubleZeroArrayTests.DuplicateZeros_ArrayWithoutZeros_ReturnsOriginalArray","location":{"start":{"line":7,"column":1},"end":{"line":19,"column":6}}},{"id":"b74f26ad-f88d-5056-13be-d242c30b9acc","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.DoubleZeroArrayTests.DuplicateZeros_ArrayWithSingleZero_ReturnsArrayWithDuplicateZero","location":{"start":{"line":21,"column":5},"end":{"line":33,"column":6}}},{"id":"3be21206-67c6-5383-687f-c7f33b877261","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.DoubleZeroArrayTests.DuplicateZeros_ArrayWithMultipleZeros_ReturnsArrayWithDuplicateZeros","location":{"start":{"line":35,"column":5},"end":{"line":47,"column":6}}},{"id":"3501b260-0aa6-4dc2-d143-7e2020316064","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.DoubleZeroArrayTests.DuplicateZeros_ArrayWithTrailingZeros_ReturnsArrayWithDuplicateZeros","location":{"start":{"line":49,"column":5},"end":{"line":61,"column":6}}},{"id":"e7a50056-f7a0-8f72-ba56-e0297c950826","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.DoubleZeroArrayTests.DuplicateZero WithoutOnes_ReturnsZero()\n    {\n        // Arrange\n        int[] nums = { 0, 0, 0 };\n\n        // Act\n        int result = FindConsecutive.FindMaxConsecutiveOnes(nums);\n\n        // Assert\n        Assert.Equal(0, result);\n    }\n\n    [Fact]\n    public void FindMaxConsecutiveOnes_ArrayWithAllOnes_ReturnsLengthOfArray()\n    {\n        // Arrange\n        int[] nums = { 1, 1, 1, 1 };\n\n        // Act\n        int result = FindConsecutive.FindMaxConsecutiveOnes(nums);\n\n        // Assert\n        Assert.Equal(nums.Length, result);\n    }\n\n    [Fact]\n    public void FindMaxConsecutiveOnes_ArrayWithIntermittentOnes_ReturnsMaxConsecutiveOnes()\n    {\n        // Arrange\n        int[] nums = { 1, 0, 1, 1, 0, 1, 1, 1 };\n\n        // Act\n        int result = FindConsecutive.FindMaxConsecutiveOnes(nums);\n\n        // Assert\n        Assert.Equal(3, result);\n    }\n\n    [Fact]\n    public void FindMaxConsecutiveOnes_ArrayWithLeadingOnes_ReturnsMaxConsecutiveOnes()\n    {\n        // Arrange\n        int[] nums = { 1, 1, 0, 1, 1 };\n\n        // Act\n        int result = FindConsecutive.FindMaxConsecutiveOnes(nums);\n\n        // Assert\n        Assert.Equal(2, result);\n    }\n\n    [Fact]\n    public void FindMaxConsecutiveOnes_ArrayWithTrailingOnes_ReturnsMaxConsecutiveOnes()\n    {\n        // Arrange\n        int[] nums = { 0, 1, 1, 1, 1 };\n\n        // Act\n        int result = FindConsecutive.FindMaxConsecutiveOnes(nums);\n\n        // Assert\n        Assert.Equal(4, result);\n    }\n}","tests":[{"id":"49c95f53-a22a-6a1a-4186-9d77a1377ef2","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.FindConsecutiveTests.FindMaxConsecutiveOnes_EmptyArray_ReturnsZero","location":{"start":{"line":7,"column":5},"end":{"line":18,"column":6}}},{"id":"dc7c406c-b1ec-25cf-ce6a-1aa5c59fa5b9","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.FindConsecutiveTests.FindMaxConsecutiveOnes_ArrayWithoutOnes_ReturnsZero","location":{"start":{"line":20,"column":5},"end":{" Numbers_ArrayWithOnlyEvenDigitNumbers_ReturnsArrayLength()\n    {\n        // Arrange\n        int[] nums = { 12, 34, 5678 };\n\n        // Act\n        int result = FindNumberWithEvenDigitsNum.FindNumbers(nums);\n\n        // Assert\n        Assert.Equal(nums.Length, result);\n    }\n\n    [Fact]\n    public void FindNumbers_ArrayWithMixedDigitNumbers_ReturnsCorrectCount()\n    {\n        // Arrange\n        int[] nums = { 12, 345, 2, 6, 7896 };\n\n        // Act\n        int result = FindNumberWithEvenDigitsNum.FindNumbers(nums);\n\n        // Assert\n        Assert.Equal(3, result);\n    }\n\n    [Fact]\n    public void FindNumbers_ArrayWithNegativeNumbers_ReturnsCorrectCount()\n    {\n        // Arrange\n        int[] nums = { -12, 345, -678, 9 };\n\n        // Act\n        int result = FindNumberWithEvenDigitsNum.FindNumbers(nums);\n\n        // Assert\n        Assert.Equal(2, result);\n    }\n\n    [Fact]\n    public void FindNumbers_ArrayWithZero_ReturnsCorrectCount()\n    {\n        // Arrange\n        int[] nums = { 0, 12, 34 };\n\n        // Act\n        int result = FindNumberWithEvenDigitsNum.FindNumbers(nums);\n\n        // Assert\n        Assert.Equal(3, result);\n    }\n}","tests":[{"id":"a5fb07d4-2930-09ad-5f68-5efd01c7aae7","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.FindNumberWithEvenDigitsNumTests.FindNumbers_EmptyArray_ReturnsZero","location":{"start":{"line":7,"column":5},"end":{"line":18,"column":6}}},{"id":"bee505db-aa84-9ed6-b8e4-3cf2183f6d2f","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.FindNumberWithEvenDigitsNumTests.FindNumbers_ArrayWithOnlyOddDigitNumbers_ReturnsZero","location":{"start":{"line":20,"column":5},"end":{"line":31,"column":6}}},{"id":"94ef4082-35df-1e0e-ebe7-237416705d2f","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.FindNumberWithEvenDigitsNumTests.FindNumbers_ArrayWithOnlyEvenDigitNumbers_ReturnsArrayLength","location":{"start":{"line":33,"column":5},"end":{"line":44,"column":6}}},{"id":"5ae793fd-55 n        var result = GeometricShapes.TriangleShape.Area(_base, height, side1, side2);\n        Assert.Equal(expectedArea, result.Item1);\n        Assert.Equal(expectedPerimeter, result.Item2);\n    }\n\n    [Theory]\n    [InlineData(12, 144, 48)]\n    [InlineData(0, 0, 0)]\n    [InlineData(-5, 25, -20)]\n    [InlineData(float.MaxValue, double.PositiveInfinity, double.PositiveInfinity)]\n    public void SquareArea_ShouldReturnCorrectArea(float side, double expectedArea, double expectedPerimeter)\n    {\n        var result = GeometricShapes.SquareShape.Area(side);\n        Assert.Equal(expectedArea, result.Item1);\n        Assert.Equal(expectedPerimeter, result.Item2);\n    }\n\n    [Theory]\n    [InlineData(20, 1256.64, 251.33)]\n    [InlineData(0, 0, 0)]\n    [InlineData(-5, -78.54, -62.83)]\n    [InlineData(float.MaxValue, double.PositiveInfinity, double.PositiveInfinity)]\n    public void CircleArea_ShouldReturnCorrectArea(float radius, double expectedArea, double expectedPerimeter)\n    {\n        var result = GeometricShapes.CircleShape.Area(radius);\n        Assert.Equal(expectedArea, result.Item1, 2); // Allow delta of 2 for floating-point precision\n        Assert.Equal(expectedPerimeter, result.Item2, 2);\n    }\n}","tests":[{"id":"b1f2af69-30df-f904-d113-093f758f378b","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.GeometricShapesTests.RectangleArea_ShouldReturnCorrectArea","location":{"start":{"line":7,"column":1},"end":{"line":17,"column":6}}},{"id":"4ef9ea5b-16b4-4986-e161-2127f90d748a","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.GeometricShapesTests.RectangleArea_ShouldReturnCorrectArea","location":{"start":{"line":7,"column":1},"end":{"line":17,"column":6}}},{"id":"1f7abaa7-903c-706e-f57a-7a6dbb04afcc","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.GeometricShapesTests.RectangleArea_ShouldReturnCorrectArea","location":{"start":{"line":7,"column":1},"end":{"line":17,"column":6}}},{"id":"a851c188-0da9-a721-dcc0-e0fdf4205024","name":"  GetUrl.ExtractRequestType(url));\n    }\n\n    [Theory]\n    [InlineData(\u0022https://example.com\u0022)]\n    [InlineData(\u0022https://example.com/\u0022)]\n    public void ExtractRequestType_UrlWithoutSegments_ReturnsEmptyString(string urlString)\n    {\n        // Arrange\n        Uri url = new Uri(urlString);\n\n        // Act\n        string result = GetUrl.ExtractRequestType(url);\n\n        // Assert\n        Assert.Equal(string.Empty, result);\n    }\n}","tests":[{"id":"384ebfc8-da6b-ea82-c89a-a96292d8bd56","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.GetUrlTests.ExtractRequestType_ValidUrl_ReturnsLastSegment","location":{"start":{"line":7,"column":5},"end":{"line":21,"column":6}}},{"id":"1f627fa8-b82a-c990-f116-9e61b88581b5","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.GetUrlTests.ExtractRequestType_ValidUrl_ReturnsLastSegment","location":{"start":{"line":7,"column":5},"end":{"line":21,"column":6}}},{"id":"3975c533-9972-ea48-0c1b-0e8cc7691842","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.GetUrlTests.ExtractRequestType_ValidUrl_ReturnsLastSegment","location":{"start":{"line":7,"column":5},"end":{"line":21,"column":6}}},{"id":"3a7b0f52-2afd-7fa3-84a7-203bec875c01","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.GetUrlTests.ExtractRequestType_NullUrl_ThrowsArgumentNullException","location":{"start":{"line":23,"column":5},"end":{"line":31,"column":6}}},{"id":"43d5278c-517b-8003-2fdd-e1a93c768fa1","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.GetUrlTests.ExtractRequestType_UrlWithoutSegments_ReturnsEmptyString","location":{"start":{"line":33,"column":5},"end":{"line":46,"column":6}}},{"id":"d1d30250-d550-86a9-af5f-fcba2c43ec6d","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.GetUrlTests.ExtractRequestType_UrlWithoutSegments_ReturnsEmptyString","location":{"start":{"line":33,"column":5},"end":{"line":46,"column":6}}}]},"/Users/tomas/Documents/Code/bakis/UnitTestGeneration.Easy.Tests.Cloude.Prompt2/IsNumberTests.cs":{"la         // Assert\n        Assert.True(result);\n    }\n}","tests":[{"id":"f44dfb65-9052-205f-e964-c9300e4fc19f","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.IsNumberTests.IsNumeric_NullString_ReturnsFalse","location":{"start":{"line":7,"column":5},"end":{"line":18,"column":6}}},{"id":"27ca9370-afb1-3b74-6999-688644487b58","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.IsNumberTests.IsNumeric_EmptyString_ReturnsFalse","location":{"start":{"line":20,"column":5},"end":{"line":31,"column":6}}},{"id":"093aec46-7054-a7f5-a807-cd58566d6c02","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.IsNumberTests.IsNumeric_ValidNumericString_ReturnsTrue","location":{"start":{"line":33,"column":5},"end":{"line":44,"column":6}}},{"id":"4d5a61c7-ac29-2164-287d-683ad4a1b5d1","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.IsNumberTests.IsNumeric_StringWithNonNumericCharacters_ReturnsFalse","location":{"start":{"line":46,"column":5},"end":{"line":57,"column":6}}},{"id":"26564480-28f9-e305-5e73-e3de06da091b","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.IsNumberTests.IsNumeric_StringWithDecimalPoint_ReturnsFalse","location":{"start":{"line":59,"column":5},"end":{"line":70,"column":6}}},{"id":"3a6e70fe-f15d-c10f-a7be-fbe76691f00c","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.IsNumberTests.IsNumeric_StringWithNegativeSign_ReturnsFalse","location":{"start":{"line":72,"column":5},"end":{"line":83,"column":6}}},{"id":"824fbcca-f495-9fb9-06fc-febaa4971b16","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.IsNumberTests.IsNumeric_StringWithLeadingZeroes_ReturnsTrue","location":{"start":{"line":85,"column":5},"end":{"line":96,"column":6}}}]},"/Users/tomas/Documents/Code/bakis/UnitTestGeneration.Easy.Tests.Cloude.Prompt2/LoanApplicationTests.cs":{"language":"cs","source":"using UnitTestGeneration.Easy.App;\n\nnamespace UnitTestGeneration.Easy.Tests.Cloude.Prompt2;\n\npublic class LoadApplicationTests\n{\n    [Theory]\n    [InlineData(18, 19, false)] // Both persons are above legal age, no kids\n    [InlineData(20, 25, false)] // Both persons are above legal age, no kids\n    public void CanGetFamilyLoan_NoKids_BothAboveLegalAge_ReturnsTrue(byte firstPersonAge, byte secondPersonAge, bool haveKids)\n    {\n        // Act\n        bool result = LoanApplication.CanGetFamilyLoan(firstPersonAge, secondPersonAge, haveKids);\n\n        // Assert\n        Assert.True(result);\n    }\n\n    [Theory]\n    [InlineData(16, 19, false)] // First person is below legal age, no kids\n    [InlineData(18, 15, false)] // Second person is below legal age, no kids\n    [InlineData(15, 16, false)] // Both persons are below legal age, no kids\n    public void CanGetFamilyLoan_NoKids_OneOrBothBelowLegalAge_ReturnsFalse(byte firstPersonAge, byte secondPersonAge, bool haveKids)\n    {\n        // Act\n        bool result = LoanApplication.CanGetFamilyLoan(firstPersonAge, secondPersonAge, haveKids);\n\n        // Assert\n        Assert.False(result);\n    }\n\n    [Theory]\n    [InlineData(18, 18, true)] // Both persons are of legal age, have kids\n    [InlineData(20, 25, true)] // Both persons are above legal age, have kids\n    public void CanGetFamilyLoan_HaveKids_BothAboveLegalAge_ReturnsTrue(byte firstPersonAge, byte secondPersonAge, bool haveKids)\n    {\n        // Act\n        bool result = LoanApplication.CanGetFamilyLoan(firstPersonAge, secondPersonAge, haveKids);\n\n        // Assert\n        Assert.True(result);\n    }\n\n    [Theory]\n    [InlineData(16, 19, true)] // First person is below legal age, have kids\n    [InlineData(18, 15, true)] // Second person is below legal age, have kids\n    [InlineData(15, 16, true)] // Both persons are below legal age, have kids\n    public void CanGetFamilyLoan_HaveKids_OneOrBothBelowLegalAge_ReturnsFalse(byte firstPersonAge, byte secondPersonAge, bool haveKids)\n    {\n        // Act\n        bool result = LoanApplication.CanGetFamilyLoan(firstPersonAge, secondPersonAge, haveKids);\n\n        // Assert\n        Assert.False(result);\n    }\n\n    [Fact]\n    public void CanGetFamilyLoan_HaveKids_CombinedAgeEqualsFiftyOne_ReturnsTrue()\n    {\n        // Arrange\n        byte firstPersonAge = 17;\n        byte secondPersonAge = 34;\n        bool haveKids = true;\n\n        // Act\n        bool result = LoanApplication.CanGetFamilyLoan(firstPersonAge, secondPersonAge, haveKids);\n\n        // Assert\n        Assert.True(result);\n    }\n\n    [Fact]\n    public void CanGetFamilyLoan_HaveKids_CombinedAgeFifty_ReturnsFalse()\n    {\n        // Arrange\n        byte firstPersonAge = 25;\n        byte secondPersonAge = 25;\n        bool haveKids = true;\n\n        // Act\n        bool result = LoanApplication.CanGetFamilyLoan(firstPersonAge, secondPersonAge, haveKids);\n\n        // Assert\n        Assert.False(result);\n    }\n}","tests":[{"id":"f6c14f66-1095-b0be-79d0-41e9ccc70377","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.LoadApplicationTests.CanGetFamilyLoan_NoKids_BothAboveLegalAge_ReturnsTrue","location":{"start":{"line":7,"column":5},"end":{"line":17,"column":6}}},{"id":"e5b55614-55aa-bc5f-7c35-f6a009eaed7d","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.LoadApplicationTests.CanGetFamilyLoan_NoKids_BothAboveLegalAge_ReturnsTrue","location":{"start":{"line":7,"column":5},"end":{"line":17,"column":6}}},{"id":"5d0705f3-0a45-6f6f-040f-ea0a5051ac24","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.LoadApplicationTests.CanGetFamilyLoan_NoKids_OneOrBothBelowLegalAge_ReturnsFalse","location":{"start":{"line":19,"column":5},"end":{"line":30,"column":6}}},{"id":"242d519a-fb5d-8f1b-aac1-11cf25f8cc4a","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.LoadApplicationTests.CanGetFamilyLoan_NoKids_OneOrBothBelowLegalAge_ReturnsFalse","location":{"start":{"line":19,"column":5},"end":{"line":30,"column":6}}},{"id":"530f3e4c-bccd-d1c3-59b1-4ca674f4f8bc","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.LoadApplicationTests.CanGetFamilyLoan_NoKids       // Arrange\n        int[] nums = { 1, 2, 3, 4, 5 };\n\n        // Act\n        int result = RemoveArrayDuplicates.RemoveDuplicates(nums);\n\n        // Assert\n        Assert.Equal(nums.Length, result);\n    }\n\n    [Fact]\n    public void RemoveDuplicates_ArrayWithDuplicates_RemovesDuplicatesAndReturnsCorrectLength()\n    {\n        // Arrange\n        int[] nums = { 0, 0, 1, 1, 1, 2, 2, 3, 3, 4 };\n        int[] expected = { 0, 1, 2, 3, 4 };\n\n        // Act\n        int result = RemoveArrayDuplicates.RemoveDuplicates(nums);\n\n        // Assert\n        Assert.Equal(expected.Length, result);\n        for (int i = 0; i \u003C result; i\u002B\u002B)\n        {\n            Assert.Equal(expected[i], nums[i]);\n        }\n    }\n\n    [Fact]\n    public void RemoveDuplicates_ArrayWithAllSameElements_ReturnsOne()\n    {\n        // Arrange\n        int[] nums = { 1, 1, 1, 1, 1 };\n\n        // Act\n        int result = RemoveArrayDuplicates.RemoveDuplicates(nums);\n\n        // Assert\n        Assert.Equal(1, result);\n        Assert.Equal(1, nums[0]);\n    }\n\n    [Fact]\n    public void RemoveDuplicates_ArrayWithNegativeValues_RemovesDuplicatesAndReturnsCorrectLength()\n    {\n        // Arrange\n        int[] nums = { -1, 0, 0, 0, 0, 3, 3, 3, 9, 9, 9, 9 };\n        int[] expected = { -1, 0, 3, 9 };\n\n        // Act\n        int result = RemoveArrayDuplicates.RemoveDuplicates(nums);\n\n        // Assert\n        Assert.Equal(expected.Length, result);\n        for (int i = 0; i \u003C result; i\u002B\u002B)\n        {\n            Assert.Equal(expected[i], nums[i]);\n        }\n    }\n}","tests":[{"id":"5d25c132-4fc8-ab5b-d8ec-768033e3e82c","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.RemoveArrayDuplicatesTests.RemoveDuplicates_EmptyArray_ReturnsZero","location":{"start":{"line":7,"column":5},"end":{"line":18,"column":6}}},{"id":"d29f7afb-45be-c438-0dce-2487188cea04","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt2.RemoveArrayDuplicatesTests.Rem ange\n        decimal input = -1;\n\n        // Act \u0026 Assert\n        Assert.Throws\u003COverflowException\u003E(() =\u003E SqrtFunction.Sqrt(input));\n    }\n\n    [Fact]\n    public void Sqrt_Zero_ReturnsZero()\n    {\n        // Arrange\n        decimal input = 0;\n        decimal expected = 0;\n\n        // Act\n        decimal result = SqrtFunction.Sqrt(input);\n\n        // Assert\n        Assert.Equal(expected, result);\n    }\n\n    [Fact]\n    public void Sqrt_LargeNumber_ReturnsApproximateResult()\n    {\n        // Arrange\n        decimal input = 1000000000000;\n        decimal expected = 1000000M; // Square root of 1,000,000,000,000 with 6 decimal places\n        decimal epsilon = 0.00001M; // Acceptable error margin\n\n        // Act\n        decimal result = SqrtFunction.Sqrt(input, epsilon);\n\n        // Assert\n        Assert.InRange(result, expected - epsilon, expected \u002B epsilon);\n    }\n}","tests":[{"id":"4d0e92b4-cdb4-a486-33a5-6ab30da652c2","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt1.SqrtFunctionTests.Sqrt_PerfectSquare_ReturnsExactResult","location":{"start":{"line":7,"column":5},"end":{"line":19,"column":6}}},{"id":"93c5912d-e501-720d-06fc-9a602ade1cfd","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt1.SqrtFunctionTests.Sqrt_NonPerfectSquare_ReturnsApproximateResult","location":{"start":{"line":21,"column":5},"end":{"line":34,"column":6}}},{"id":"4538a2d1-8771-8f1d-4cf3-3c628e91af0a","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt1.SqrtFunctionTests.Sqrt_NegativeNumber_ThrowsOverflowException","location":{"start":{"line":36,"column":5},"end":{"line":44,"column":6}}},{"id":"43b0e597-71df-fcd2-0043-e846de873d1c","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt1.SqrtFunctionTests.Sqrt_Zero_ReturnsZero","location":{"start":{"line":46,"column":5},"end":{"line":58,"column":6}}},{"id":"d6908bb2-3ddd-53c1-b8cc-5c6eebed9311","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt1.SqrtFunctionTests.Sqrt_LargeNumber_ReturnsApp rrectly()\n    {\n        // Arrange\n        float _base = 5;\n        float height = 13;\n        float side1 = 12;\n        float side2 = 10;\n\n        // Act\n        var result = GeometricShapes.TriangleShape.Area(_base, height, side1, side2);\n\n        // Assert\n        Assert.Equal(_base * height / 2, result.Item1);\n        Assert.Equal(_base \u002B side1 \u002B side2, result.Item2);\n    }\n\n    [Fact]\n    public void SquareArea_ShouldCalculateCorrectly()\n    {\n        // Arrange\n        float side = 12;\n\n        // Act\n        var result = GeometricShapes.SquareShape.Area(side);\n\n        // Assert\n        Assert.Equal(side * side, result.Item1);\n        Assert.Equal(4 * side, result.Item2);\n    }\n\n    [Fact]\n    public void CircleArea_ShouldCalculateCorrectly()\n    {\n        // Arrange\n        float radius = 20;\n\n        // Act\n        var result = GeometricShapes.CircleShape.Area(radius);\n\n        // Assert\n        Assert.Equal(3.14 * radius * radius, result.Item1, precision: 5); // using precision 5 for floating point comparison\n        Assert.Equal(4 * 3.14 * radius, result.Item2, precision: 5);\n    }\n}","tests":[{"id":"46e8250a-e557-e422-df9c-02340fcfe5ff","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt1.GeometricShapesTests.RectangleArea_ShouldCalculateCorrectly","location":{"start":{"line":7,"column":5},"end":{"line":20,"column":6}}},{"id":"6c04407f-50a0-4cc3-24a4-31dc6909c64b","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt1.GeometricShapesTests.TriangleArea_ShouldCalculateCorrectly","location":{"start":{"line":22,"column":5},"end":{"line":37,"column":6}}},{"id":"69fde577-6636-ca23-5e46-219986eb5881","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt1.GeometricShapesTests.SquareArea_ShouldCalculateCorrectly","location":{"start":{"line":39,"column":5},"end":{"line":51,"column":6}}},{"id":"888e7df3-f080-45da-11b8-c76514618172","name":"UnitTestGeneration.Easy.Tests.ChatGPT.Prompt1.GeometricShapesTests.CircleAr ests.cs":{"language":"cs","source":"using UnitTestGeneration.Easy.App;\n\nnamespace UnitTestGeneration.Easy.Tests.Cloude.Prompt3;\n\npublic class CheckForPalindromeTests\n{\n    [Theory]\n    [InlineData(121)] // Palindrome positive integer\n    [InlineData(1221)] // Palindrome positive integer with more than 2 digits\n    public void IsPalindrome_PositiveInteger_ReturnsTrue(int input)\n    {\n        bool result = CheckForPalindrome.IsPalindrome(input);\n        Assert.True(result);\n    }\n\n    [Theory]\n    [InlineData(-121)] // Negative palindrome integer\n    [InlineData(0)] // Zero\n    public void IsPalindrome_NonPalindrome_ReturnsFalse(int input)\n    {\n        bool result = CheckForPalindrome.IsPalindrome(input);\n        Assert.False(result);\n    }\n\n    [Theory]\n    [InlineData(12321)] // Non-palindrome positive integer\n    [InlineData(123456)] // Non-palindrome positive integer with even number of digits\n    public void IsPalindrome_NonPalindromePositiveInteger_ReturnsFalse(int input)\n    {\n        bool result = CheckForPalindrome.IsPalindrome(input);\n        Assert.False(result);\n    }\n\n    [Theory]\n    [InlineData(int.MinValue)] // Minimum integer value\n    [InlineData(int.MaxValue)] // Maximum integer value\n    public void IsPalindrome_IntegerOverflowEdgeCases_ReturnsExpectedResult(int input)\n    {\n        bool expectedResult = input.ToString() == (new string(input.ToString().Reverse().ToArray()));\n        bool result = CheckForPalindrome.IsPalindrome(input);\n        Assert.Equal(expectedResult, result);\n    }\n}","tests":[{"id":"89ede43b-aba0-c7df-fd67-2db01e193b83","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt3.CheckForPalindromeTests.IsPalindrome_PositiveInteger_ReturnsTrue","location":{"start":{"line":7,"column":5},"end":{"line":14,"column":6}}},{"id":"d8a77891-f2dc-23f9-c582-ae27f7a0d085","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt3.CheckForPalindromeTests.IsPalindrome_PositiveInteger_ReturnsTrue","location":{"s ubleZeroArray.DuplicateZeros(input);\n\n        // Assert\n        Assert.Empty(result);\n    }\n\n    [Fact]\n    public void DuplicateZeros_ArrayWithoutZeros_ReturnsOriginalArray()\n    {\n        // Arrange\n        int[] input = { 1, 2, 3 };\n        int[] expected = { 1, 2, 3 };\n\n        // Act\n        int[] result = DoubleZeroArray.DuplicateZeros(input);\n\n        // Assert\n        Assert.Equal(expected, result);\n    }\n\n    [Fact]\n    public void DuplicateZeros_ArrayWithZeros_DuplicatesZeros()\n    {\n        // Arrange\n        int[] input = { 1, 0, 2, 3, 0, 4, 5, 0 };\n        int[] expected = { 1, 0, 0, 2, 3, 0, 0, 4, 5, 0, 0 };\n\n        // Act\n        int[] result = DoubleZeroArray.DuplicateZeros(input);\n\n        // Assert\n        Assert.Equal(expected, result);\n    }\n\n    [Fact]\n    public void DuplicateZeros_ArrayWithTrailingZeros_DuplicatesZerosUntilEnd()\n    {\n        // Arrange\n        int[] input = { 1, 2, 3, 0, 0, 0 };\n        int[] expected = { 1, 2, 3, 0, 0, 0, 0, 0 };\n\n        // Act\n        int[] result = DoubleZeroArray.DuplicateZeros(input);\n\n        // Assert\n        Assert.Equal(expected, result);\n    }\n\n    [Fact]\n    public void DuplicateZeros_ArrayWithLengthOverflow_TruncatesOutput()\n    {\n        // Arrange\n        int[] input = { 1, 0, 2, 0, 3, 0, 4, 0, 5 };\n        int[] expected = { 1, 0, 0, 2, 0, 0, 3, 0, 0 };\n\n        // Act\n        int[] result = DoubleZeroArray.DuplicateZeros(input);\n\n        // Assert\n        Assert.Equal(expected, result);\n    }\n}","tests":[{"id":"2c160e5e-f8d1-9c7a-243b-083ba0f5c95a","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt3.DoubleZeroArrayTests.DuplicateZeros_EmptyArray_ReturnsEmptyArray","location":{"start":{"line":7,"column":5},"end":{"line":18,"column":6}}},{"id":"e222c08b-08d7-2726-0d81-4d14cc9a0d37","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt3.DoubleZeroArrayTests.DuplicateZeros_ArrayWithoutZeros_ReturnsOriginalArray","location":{"start":{"li ts/Code/bakis/UnitTestGeneration.Easy.Tests.Cloude.Prompt3/FindNumberWithEvenDigitsNumTests.cs":{"language":"cs","source":"using UnitTestGeneration.Easy.App;\n\nnamespace UnitTestGeneration.Easy.Tests.Cloude.Prompt3;\n\npublic class FindNumberWithEvenDigitsNumTests\n{\n[Fact]\n    public void FindNumbers_EmptyArray_ReturnsZero()\n    {\n        // Arrange\n        int[] nums = Array.Empty\u003Cint\u003E();\n\n        // Act\n        int result = FindNumberWithEvenDigitsNum.FindNumbers(nums);\n\n        // Assert\n        Assert.Equal(0, result);\n    }\n\n    [Fact]\n    public void FindNumbers_ArrayWithNoEvenDigitNumbers_ReturnsZero()\n    {\n        // Arrange\n        int[] nums = { 1, 23, 456 };\n\n        // Act\n        int result = FindNumberWithEvenDigitsNum.FindNumbers(nums);\n\n        // Assert\n        Assert.Equal(0, result);\n    }\n\n    [Fact]\n    public void FindNumbers_ArrayWithAllEvenDigitNumbers_ReturnsArrayLength()\n    {\n        // Arrange\n        int[] nums = { 12, 3456, 78 };\n\n        // Act\n        int result = FindNumberWithEvenDigitsNum.FindNumbers(nums);\n\n        // Assert\n        Assert.Equal(nums.Length, result);\n    }\n\n    [Fact]\n    public void FindNumbers_ArrayWithMixedDigitNumbers_ReturnsCorrectCount()\n    {\n        // Arrange\n        int[] nums = { 12, 345, 6789, 1 };\n\n        // Act\n        int result = FindNumberWithEvenDigitsNum.FindNumbers(nums);\n\n        // Assert\n        Assert.Equal(2, result);\n    }\n\n    [Fact]\n    public void FindNumbers_ArrayWithNegativeNumbers_ReturnsCorrectCount()\n    {\n        // Arrange\n        int[] nums = { -12, 345, -6789, 1 };\n\n        // Act\n        int result = FindNumberWithEvenDigitsNum.FindNumbers(nums);\n\n        // Assert\n        Assert.Equal(2, result);\n    }\n\n    [Fact]\n    public void FindNumbers_ArrayWithZero_ReturnsCorrectCount()\n    {\n        // Arrange\n        int[] nums = { 0, 12, 345 };\n\n        // Act\n        int result = FindNumberWithEvenDigitsNum.FindNumbers(nums);\n\n        // Assert\n        Assert.Equal(1, result);\n    }\n\n    [Fact]\n    public void FindNumbers_ArrayWithMaxValue_ReturnsCorrectCount()\n    {\n        // Arrange\n        int[] nums = { int.MaxValue, 12, 345 };\n\n        // Act\n        int result = FindNumberWithEvenDigitsNum.FindNumbers(nums);\n\n        // Assert\n        Assert.Equal(1, result);\n    }\n\n    [Fact]\n    public void FindNumbers_ArrayWithMinValue_ReturnsCorrectCount()\n    {\n        // Arrange\n        int[] nums = { int.MinValue, 12, 345 };\n\n        // Act\n        int result = FindNumberWithEvenDigitsNum.FindNumbers(nums);\n\n        // Assert\n        Assert.Equal(1, result);\n    }\n}","tests":[{"id":"384f2fd3-190b-b9a6-cd63-ce235608f684","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt3.FindNumberWithEvenDigitsNumTests.FindNumbers_EmptyArray_ReturnsZero","location":{"start":{"line":7,"column":1},"end":{"line":18,"column":6}}},{"id":"2c95ac54-0258-6569-3705-673613786ec0","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt3.FindNumberWithEvenDigitsNumTests.FindNumbers_ArrayWithNoEvenDigitNumbers_ReturnsZero","location":{"start":{"line":20,"column":5},"end":{"line":31,"column":6}}},{"id":"598eb428-4c75-2782-f263-0f01f10708fd","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt3.FindNumberWithEvenDigitsNumTests.FindNumbers_ArrayWithAllEvenDigitNumbers_ReturnsArrayLength","location":{"start":{"line":33,"column":5},"end":{"line":44,"column":6}}},{"id":"56f6121f-e335-7ce6-499f-a075f3fedce7","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt3.FindNumberWithEvenDigitsNumTests.FindNumbers_ArrayWithMixedDigitNumbers_ReturnsCorrectCount","location":{"start":{"line":46,"column":5},"end":{"line":57,"column":6}}},{"id":"403d61c8-6d1d-b37a-6daa-089fe766ea85","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt3.FindNumberWithEvenDigitsNumTests.FindNumbers_ArrayWithNegativeNumbers_ReturnsCorrectCount","location":{"start":{"line":59,"column":5},"end":{"line":70  float height, float side1, float side2, double expectedArea, double expectedPerimeter)\n    {\n        // Arrange\n\n        // Act\n        var result = GeometricShapes.TriangleShape.Area(_base, height, side1, side2);\n\n        // Assert\n        Assert.Equal(expectedArea, result.Item1, 6);\n        Assert.Equal(expectedPerimeter, result.Item2, 6);\n    }\n\n    [Theory]\n    [InlineData(12, 144, 48)]\n    [InlineData(0, 0, 0)]\n    [InlineData(-5, 25, -20)]\n    [InlineData(float.MaxValue, float.MaxValue * float.MaxValue, float.MaxValue * 4)]\n    public void SquareArea_ShouldCalculateCorrectly(float side, double expectedArea, double expectedPerimeter)\n    {\n        // Arrange\n\n        // Act\n        var result = GeometricShapes.SquareShape.Area(side);\n\n        // Assert\n        Assert.Equal(expectedArea, result.Item1, 6);\n        Assert.Equal(expectedPerimeter, result.Item2, 6);\n    }\n\n    [Theory]\n    [InlineData(20, 1256.64, 251.33)]\n    [InlineData(0, 0, 0)]\n    [InlineData(-5, 78.54, -62.83)]\n    [InlineData(float.MaxValue, 3.14f * float.MaxValue * float.MaxValue, 4f * 3.14f * float.MaxValue)]\n    public void CircleArea_ShouldCalculateCorrectly(float radius, double expectedArea, double expectedPerimeter)\n    {\n        // Arrange\n\n        // Act\n        var result = GeometricShapes.CircleShape.Area(radius);\n\n        // Assert\n        Assert.Equal(expectedArea, result.Item1, 2);\n        Assert.Equal(expectedPerimeter, result.Item2, 2);\n    }\n}","tests":[{"id":"9a49eddd-07bb-ec6a-6219-2dc1c25ef481","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt3.GeometricShapesTests.RectangleArea_ShouldCalculateCorrectly","location":{"start":{"line":7,"column":1},"end":{"line":22,"column":6}}},{"id":"9bc8101c-2638-3c90-b51d-d59e9689cee1","name":"UnitTestGeneration.Easy.Tests.Cloude.Prompt3.GeometricShapesTests.RectangleArea_ShouldCalculateCorrectly","location":{"start":{"line":7,"column":1},"end":{"line":22,"column":6}}},{"id":"f3a1537a-736c-89 ests.cs":{"language":"cs","source":"using UnitTestGeneration.Moderate.App;\n\nnamespace UnitTestGeneration.Moderate.Tests.Gemini.Prompt1;\n\npublic class PrimeNumbersTests\n{\n        [Fact]\n        public void IsNumberEven_ShouldReturnTrueForEvenNumbers()\n        {\n            Assert.True(PrimeNumbers.IsNumberEven(2));\n            Assert.True(PrimeNumbers.IsNumberEven(4));\n            Assert.True(PrimeNumbers.IsNumberEven(10));\n        }\n\n        [Fact]\n        public void IsNumberEven_ShouldReturnFalseForOddNumbers()\n        {\n            Assert.False(PrimeNumbers.IsNumberEven(1));\n            Assert.False(PrimeNumbers.IsNumberEven(3));\n            Assert.False(PrimeNumbers.IsNumberEven(9));\n        }\n\n        [Fact]\n        public void IsNumberPrime_ShouldIdentifySmallPrimesCorrectly()\n        {\n            Assert.True(PrimeNumbers.IsNumberPrime(2));\n            Assert.True(PrimeNumbers.IsNumberPrime(3));\n            Assert.True(PrimeNumbers.IsNumberPrime(5));\n            Assert.True(PrimeNumbers.IsNumberPrime(7));\n            Assert.True(PrimeNumbers.IsNumberPrime(11));\n        }\n\n        [Fact]\n        public void IsNumberPrime_ShouldIdentifyNonPrimesCorrectly()\n        {\n            Assert.False(PrimeNumbers.IsNumberPrime(1));\n            Assert.False(PrimeNumbers.IsNumberPrime(4));\n            Assert.False(PrimeNumbers.IsNumberPrime(6));\n            Assert.False(PrimeNumbers.IsNumberPrime(8));\n            Assert.False(PrimeNumbers.IsNumberPrime(9));\n        }\n\n        [Fact]\n        public void PrimeTest_ShouldIdentifyPrimesCorrectly()\n        {\n            Assert.True(PrimeNumbers.PrimeTest(2));\n            Assert.True(PrimeNumbers.PrimeTest(3));\n            Assert.True(PrimeNumbers.PrimeTest(5));\n            Assert.True(PrimeNumbers.PrimeTest(7));\n            Assert.True(PrimeNumbers.PrimeTest(11));\n        }\n\n        [Fact]\n        public void PrimeTest_ShouldIdentifyNonPrimesCorrectly()\n        {\n            Assert.False(PrimeNumbers.PrimeTest(1));\n            Assert.False(PrimeNumbers.PrimeTest(4));\n            Assert.False(PrimeNumbers.PrimeTest(6));\n            Assert.False(PrimeNumbers.PrimeTest(8));\n            Assert.False(PrimeNumbers.PrimeTest(9));\n        }\n\n        [Fact]\n        public void PrimeTest_ShouldHandleInvalidInput()\n        {\n            Assert.False(PrimeNumbers.PrimeTest(0));\n            Assert.False(PrimeNumbers.PrimeTest(-1));\n        }\n}","tests":[{"id":"3402f1f4-d98f-00b7-dfce-14187564d2c7","name":"UnitTestGeneration.Moderate.Tests.Gemini.Prompt1.PrimeNumbersTests.IsNumberEven_ShouldReturnTrueForEvenNumbers","location":{"start":{"line":7,"column":9},"end":{"line":13,"column":10}}},{"id":"7700c817-b7f7-660f-e477-6be7a0beceaf","name":"UnitTestGeneration.Moderate.Tests.Gemini.Prompt1.PrimeNumbersTests.IsNumberEven_ShouldReturnFalseForOddNumbers","location":{"start":{"line":15,"column":9},"end":{"line":21,"column":10}}},{"id":"f2fee058-f223-b561-50ed-280d8cdf8322","name":"UnitTestGeneration.Moderate.Tests.Gemini.Prompt1.PrimeNumbersTests.IsNumberPrime_ShouldIdentifySmallPrimesCorrectly","location":{"start":{"line":23,"column":9},"end":{"line":31,"column":10}}},{"id":"d6cf775b-2a2c-3341-57d6-823a764d485b","name":"UnitTestGeneration.Moderate.Tests.Gemini.Prompt1.PrimeNumbersTests.IsNumberPrime_ShouldIdentifyNonPrimesCorrectly","location":{"start":{"line":33,"column":9},"end":{"line":41,"column":10}}},{"id":"02167b99-5740-732c-d904-ecfdba3f9af0","name":"UnitTestGeneration.Moderate.Tests.Gemini.Prompt1.PrimeNumbersTests.PrimeTest_ShouldIdentifyPrimesCorrectly","location":{"start":{"line":43,"column":9},"end":{"line":51,"column":10}}},{"id":"39cd5107-9bb0-9c32-a127-20ba1d5a2044","name":"UnitTestGeneration.Moderate.Tests.Gemini.Prompt1.PrimeNumbersTests.PrimeTest_ShouldIdentifyNonPrimesCorrectly","location":{"start":{"line":53,"column":9},"end":{"line":61,"column":10}}},{"id":"16f0489c-ed1f-0887-0be8-be188b22d901","name":"UnitTestGenerat \n        Assert.False(result);\n    }\n\n    [Fact]\n    public void CheckIfExists_ArrayWithNonZeroValuesAndDoubleExists_ReturnsTrue()\n    {\n        // Arrange\n        int[] arr = { 1, 2, 3, 4, 8 };\n\n        // Act\n        bool result = CheckIfDoubleExists.CheckIfExists(arr);\n\n        // Assert\n        Assert.True(result);\n    }\n\n    [Fact]\n    public void CheckIfExists_ArrayWithNonZeroValuesAndDoubleDoesNotExist_ReturnsFalse()\n    {\n        // Arrange\n        int[] arr = { 1, 3, 5, 7, 9 };\n\n        // Act\n        bool result = CheckIfDoubleExists.CheckIfExists(arr);\n\n        // Assert\n        Assert.False(result);\n    }\n\n    [Fact]\n    public void CheckIfExists_ArrayWithZeroAndNonZeroValues_ReturnsTrue()\n    {\n        // Arrange\n        int[] arr = { 0, 1, 2, 3, 0 };\n\n        // Act\n        bool result = CheckIfDoubleExists.CheckIfExists(arr);\n\n        // Assert\n        Assert.True(result);\n    }\n\n    [Fact]\n    public void CheckIfExists_ArrayWithOnlyZeroes_ReturnsTrue()\n    {\n        // Arrange\n        int[] arr = { 0, 0, 0, 0 };\n\n        // Act\n        bool result = CheckIfDoubleExists.CheckIfExists(arr);\n\n        // Assert\n        Assert.True(result);\n    }\n}","tests":[{"id":"b4981f07-6cae-fee6-f6c9-21c5d5e4ba09","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.CheckIfDoubleExistsTests.CheckIfExists_EmptyArray_ReturnsFalse","location":{"start":{"line":7,"column":5},"end":{"line":18,"column":6}}},{"id":"b4d3fd4e-10d5-3c23-5769-fa3af397b676","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.CheckIfDoubleExistsTests.CheckIfExists_ArrayWithNonZeroValuesAndDoubleExists_ReturnsTrue","location":{"start":{"line":20,"column":5},"end":{"line":31,"column":6}}},{"id":"794a76cd-b8e6-f141-1ec1-82d6e3a7b75f","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.CheckIfDoubleExistsTests.CheckIfExists_ArrayWithNonZeroValuesAndDoubleDoesNotExist_ReturnsFalse","location":{"start":{"line":33,"column":5},"end":{"li        Assert.Equal(expected, result);\n    }\n\n    [Fact]\n    public void ReplaceElements_ShouldHandleArrayWithAllElementsSame()\n    {\n        // Arrange\n        int[] input = { 5, 5, 5, 5 };\n        int[] expected = { 5, 5, 5, -1 };\n\n        // Act\n        var result = ElementReplacement.ReplaceElements(input);\n\n        // Assert\n        Assert.Equal(expected, result);\n    }\n\n    [Fact]\n    public void ReplaceElements_ShouldHandleArrayWithDescendingOrder()\n    {\n        // Arrange\n        int[] input = { 10, 9, 8, 7, 6, 5 };\n        int[] expected = { 9, 8, 7, 6, 5, -1 };\n\n        // Act\n        var result = ElementReplacement.ReplaceElements(input);\n\n        // Assert\n        Assert.Equal(expected, result);\n    }\n\n    [Fact]\n    public void ReplaceElements_ShouldHandleArrayWithAscendingOrder()\n    {\n        // Arrange\n        int[] input = { 5, 6, 7, 8, 9, 10 };\n        int[] expected = { 10, 10, 10, 10, 10, -1 };\n\n        // Act\n        var result = ElementReplacement.ReplaceElements(input);\n\n        // Assert\n        Assert.Equal(expected, result);\n    }\n}","tests":[{"id":"50afa42b-2abf-e12b-af61-b0d2e43eb7f4","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.ElementReplacementTests.ReplaceElements_ShouldReplaceElementsWithGreatestElementOnRightSide","location":{"start":{"line":7,"column":1},"end":{"line":20,"column":6}}},{"id":"9fdc825c-5fa4-2917-f659-f068bf619e83","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.ElementReplacementTests.ReplaceElements_ShouldReplaceElementsWithGreatestElementOnRightSide","location":{"start":{"line":7,"column":1},"end":{"line":20,"column":6}}},{"id":"53885422-3a51-f24b-6c9d-da8c493ec13d","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.ElementReplacementTests.ReplaceElements_ShouldReplaceElementsWithGreatestElementOnRightSide","location":{"start":{"line":7,"column":1},"end":{"line":20,"column":6}}},{"id":"c3a09808-02c3-0c8a-8551-06d0dd797e30","name":"UnitTestGener ractionConverters();\n\n        // Act\n        decimal result = converters.InchesSplit(inchesTxt);\n\n        // Assert\n        Assert.Equal(expected, result);\n    }\n}","tests":[{"id":"14a3768e-b0f7-c404-7798-939253eda1d6","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.FractionConvertersTests.SafeDivision_ValidInputs_ReturnsCorrectResult","location":{"start":{"line":7,"column":3},"end":{"line":20,"column":6}}},{"id":"6637ed1e-c27e-0661-9a25-6460a6a1f677","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.FractionConvertersTests.SafeDivision_NumeratorIsZero_ThrowsDivideByZeroException","location":{"start":{"line":22,"column":5},"end":{"line":31,"column":6}}},{"id":"1294422c-5d0c-8b3f-0a52-a965f4bb6b42","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.FractionConvertersTests.SafeDivision_DenominatorIsZero_ThrowsDivideByZeroException","location":{"start":{"line":33,"column":5},"end":{"line":42,"column":6}}},{"id":"3632147b-0698-a24a-34fd-168dd3a5fddf","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.FractionConvertersTests.Fraction_ValidInputs_ReturnsCorrectResult","location":{"start":{"line":44,"column":5},"end":{"line":59,"column":6}}},{"id":"ea0f163a-69f1-0a4c-8176-dbfc441db141","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.FractionConvertersTests.Fraction_ValidInputs_ReturnsCorrectResult","location":{"start":{"line":44,"column":5},"end":{"line":59,"column":6}}},{"id":"c4c1a0f2-e5a7-54d2-7bfa-9feb80f0e1b7","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.FractionConvertersTests.Fraction_ValidInputs_ReturnsCorrectResult","location":{"start":{"line":44,"column":5},"end":{"line":59,"column":6}}},{"id":"62bde8af-83fc-7c54-9b74-4fbe28808c24","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.FractionConvertersTests.Fraction_ValidInputs_ReturnsCorrectResult","location":{"start":{"line":44,"column":5},"end":{"line":59,"column":6}}},{"id":"fc420e54-2d6f-eb66-c458-f5b9f24715b6","name":"UnitTestGeneration.Moderate.T 3\u0022, \u0022\u002B\u0022 }, postfix);\n    }\n\n    [Fact]\n    public void InfixToPostfix_ComplexExpression_ReturnsCorrectPostfix()\n    {\n        // Arrange\n        string infix = \u00222 \u002B 3 * 4 - 5 / 6 ^ 2 ^ 3\u0022;\n\n        // Act\n        List\u003Cstring\u003E postfix = _app.InfixToPostfix(infix);\n\n        // Assert\n        Assert.Equal(new[] { \u00222\u0022, \u00223\u0022, \u00224\u0022, \u0022\u00D7\u0022, \u0022\u002B\u0022, \u00225\u0022, \u00226\u0022, \u00222\u0022, \u00223\u0022, \u0022^\u0022, \u0022^\u0022, \u0022\u00F7\u0022, \u0022-\u0022 }, postfix);\n    }\n\n    [Fact]\n    public void InfixToPostfix_ExpressionWithParentheses_ReturnsCorrectPostfix()\n    {\n        // Arrange\n        string infix = \u0022(2 \u002B 3) * 4 - (5 / 6) ^ (2 ^ 3)\u0022;\n\n        // Act\n        List\u003Cstring\u003E postfix = _app.InfixToPostfix(infix);\n\n        // Assert\n        Assert.Equal(new[] { \u00222\u0022, \u00223\u0022, \u0022\u002B\u0022, \u00224\u0022, \u0022\u00D7\u0022, \u00225\u0022, \u00226\u0022, \u0022\u00F7\u0022, \u00222\u0022, \u00223\u0022, \u0022^\u0022, \u0022^\u0022, \u0022-\u0022 }, postfix);\n    }\n\n    [Fact]\n    public void InfixToPostfix_EmptyInfix_ReturnsEmptyPostfix()\n    {\n        // Arrange\n        string infix = \u0022\u0022;\n\n        // Act\n        List\u003Cstring\u003E postfix = _app.InfixToPostfix(infix);\n\n        // Assert\n        Assert.Empty(postfix);\n    }\n\n    [Fact]\n    public void InfixToPostfix_InvalidExpression_ThrowsException()\n    {\n        // Arrange\n        string infix = \u00222 \u002B 3 )\u0022;\n\n        // Act \u0026 Assert\n        Assert.Throws\u003CSystem.Exception\u003E(() =\u003E _app.InfixToPostfix(infix));\n    }\n}","tests":[{"id":"c0db277c-de85-2fc6-dc24-6ed72f197cff","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.InfixToPostfixAppTests.InfixToPostfix_SingleNumber_ReturnsNumberAsPostfix","location":{"start":{"line":14,"column":5},"end":{"line":26,"colu neData(15, 20)]\n    [InlineData(10, 12)]\n    public void CanGetFamilyLoan_WhenOneAgeUnderLegalAge_ReturnsFalse(int firstPersonAge, int secondPersonAge)\n    {\n        // Arrange\n        // Act\n        bool result = LoanApplication.CanGetFamilyLoan(firstPersonAge, secondPersonAge);\n\n        // Assert\n        Assert.False(result);\n    }\n\n    [Fact]\n    public void CanGetFamilyLoan_WhenBothAgesOnLegalAge_ReturnsFalse()\n    {\n        // Arrange\n        int firstPersonAge = 17;\n        int secondPersonAge = 17;\n\n        // Act\n        bool result = LoanApplication.CanGetFamilyLoan(firstPersonAge, secondPersonAge);\n\n        // Assert\n        Assert.False(result);\n    }\n\n    [Theory]\n    [InlineData(1000, 2000)]\n    [InlineData(5000, 5000)]\n    [InlineData(10000, 20000)]\n    public void FindMonthlyPaymentSize_WithValidSalaries_ReturnsCorrectPayment(int firstPersonSalary, int secondPersonSalary)\n    {\n        // Arrange\n        int expectedPayment = (firstPersonSalary \u002B secondPersonSalary) / 10 * 3;\n\n        // Act\n        int result = LoanApplication.FindMonthlyPaymentSize(firstPersonSalary, secondPersonSalary);\n\n        // Assert\n        Assert.Equal(expectedPayment, result);\n    }\n\n    [Fact]\n    public void IsFamilyApplicableForLoad_WhenBothAgesUnderLegalAge_ReturnsFalseAndZeroPayment()\n    {\n        // Arrange\n        Tuple\u003Cint, int\u003E ages = new Tuple\u003Cint, int\u003E(16, 15);\n        Tuple\u003Cint, int\u003E salaries = new Tuple\u003Cint, int\u003E(1000, 2000);\n\n        // Act\n        Tuple\u003Cbool, int\u003E result = LoanApplication.IsFamilyApplicableForLoad(ages, salaries);\n\n        // Assert\n        Assert.False(result.Item1);\n        Assert.Equal(0, result.Item2);\n    }\n\n    [Fact]\n    public void IsFamilyApplicableForLoad_WhenPaymentSizeBelowMinimum_ReturnsFalseAndCorrectPayment()\n    {\n        // Arrange\n        Tuple\u003Cint, int\u003E ages = new Tuple\u003Cint, int\u003E(20, 25);\n        Tuple\u003Cint, int\u003E salaries = new Tuple\u003Cint, int\u003E(500, 500);\n        int expectedPayment = (500 \u002B 500) / 10 * 3;\n\n        // Act\n        Tuple\u003Cbool, int\u003E result = LoanApplication.IsFamilyApplicableForLoad(ages, salaries);\n\n        // Assert\n        Assert.False(result.Item1);\n        Assert.Equal(expectedPayment, result.Item2);\n    }\n\n    [Fact]\n    public void IsFamilyApplicableForLoad_WhenEligibleForLoan_ReturnsTrueAndCorrectPayment()\n    {\n        // Arrange\n        Tuple\u003Cint, int\u003E ages = new Tuple\u003Cint, int\u003E(25, 30);\n        Tuple\u003Cint, int\u003E salaries = new Tuple\u003Cint, int\u003E(5000, 10000);\n        int expectedPayment = (5000 \u002B 10000) / 10 * 3;\n\n        // Act\n        Tuple\u003Cbool, int\u003E result = LoanApplication.IsFamilyApplicableForLoad(ages, salaries);\n\n        // Assert\n        Assert.True(result.Item1);\n        Assert.Equal(expectedPayment, result.Item2);\n    }\n}","tests":[{"id":"f4861135-0e86-7899-26a1-a49530c559f6","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.LoanApplicationTests.CanGetFamilyLoan_WhenBothAgesAboveLegalAge_ReturnsTrue","location":{"start":{"line":7,"column":1},"end":{"line":19,"column":6}}},{"id":"2fb90156-6daf-e80e-194e-2dd549e39118","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.LoanApplicationTests.CanGetFamilyLoan_WhenBothAgesAboveLegalAge_ReturnsTrue","location":{"start":{"line":7,"column":1},"end":{"line":19,"column":6}}},{"id":"44fe51c2-20e6-31d6-6056-bf607f596f6a","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.LoanApplicationTests.CanGetFamilyLoan_WhenBothAgesAboveLegalAge_ReturnsTrue","location":{"start":{"line":7,"column":1},"end":{"line":19,"column":6}}},{"id":"cd1102b2-9e9e-97c4-4a92-9f6e653d4b97","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.LoanApplicationTests.CanGetFamilyLoan_WhenOneAgeUnderLegalAge_ReturnsFalse","location":{"start":{"line":21,"column":5},"end":{"line":33, Fact]\n    public void EvaluatePostfix_InsufficientOperands_ThrowsException()\n    {\n        // Arrange\n        var postfixEvaluation = new PostfixEvaluation();\n        var postfix = new List\u003Cstring\u003E { \u00222\u0022, \u0022\u002B\u0022 };\n\n        // Act \u0026 Assert\n        Assert.Throws\u003CInvalidOperationException\u003E(() =\u003E postfixEvaluation.EvaluatePostix(postfix));\n    }\n\n    [Fact]\n    public void EvaluatePostfix_DivideByZero_ThrowsException()\n    {\n        // Arrange\n        var postfixEvaluation = new PostfixEvaluation();\n        var postfix = new List\u003Cstring\u003E { \u00222\u0022, \u00220\u0022, \u0022\u00F7\u0022 };\n\n        // Act \u0026 Assert\n        Assert.Throws\u003CDivideByZeroException\u003E(() =\u003E postfixEvaluation.EvaluatePostix(postfix));\n    }\n}","tests":[{"id":"d71f69a0-074a-8a8a-0a61-483b5758ad99","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.PostfixEvaluationTests.EvaluatePostfix_ValidInput_ReturnsCorrectResult","location":{"start":{"line":7,"column":5},"end":{"line":19,"column":6}}},{"id":"501fad99-d2fc-09e9-55e6-9c7fd52483cc","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.PostfixEvaluationTests.EvaluatePostfix_InvalidInput_ReturnsExpectedResult","location":{"start":{"line":21,"column":5},"end":{"line":33,"column":6}}},{"id":"2e8ed4e7-1bc1-1048-54b4-f6d5fb86d99b","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.PostfixEvaluationTests.EvaluatePostfix_EmptyInput_ReturnsEmptyString","location":{"start":{"line":35,"column":5},"end":{"line":47,"column":6}}},{"id":"c66f6d47-4f7a-719a-d8d9-940225e48f42","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.PostfixEvaluationTests.EvaluatePostfix_InsufficientOperands_ThrowsException","location":{"start":{"line":49,"column":5},"end":{"line":58,"column":6}}},{"id":"69f1bd0f-8384-1583-00b2-076981db5cf0","name":"UnitTestGeneration.Moderate.Tests.Cloude.Prompt3.PostfixEvaluationTests.EvaluatePostfix_DivideByZero_ThrowsExcepti
